VT4(Klientas gali:
Pateikti kreipinį;
Peržvelgti savo kreipinius;
Prasitęsti egzistuojančią sutartį;
Sudaryti naują sutartį.)

VT4(Kreipinį peržiūrėti gali betkuris darbuotojas, tačiau spręsti vienu metu gali tik vienas (pažymėtas atsakingu) darbuotojas;
Kreipinys, kurio būsena yra pakeičiame į "Išspręstas" būseną, nebegali būti atnaujinamas;
Prie išpręsto kreipinio galima pridėti komentarus ir sieti vėliau pateiktus kreipinius.)
